import { react, useState } from 'react';
import Container from 'react-bootstrap/Container';
import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import Form from '../Components/Form';
import { CopyBlock, dracula } from 'react-code-blocks';
import { sample, Heading } from '..Components';

const Body = () => {
    const [code, setCode] = useState(Heading["jsx"]);
    const [lang, setLang] = useState("jsx");
    const [lineNumbers, setLine] = useState(true);
    return (
        <div>
            <Container>
                <Row>
                    <h4>Hello World!</h4>
                    <h4>Should Be Code Snippet below:</h4>
                    <div>
                    <CopyBlock
                        language={lang}
                        text={code}
                        showLineNumbers={lineNumbers}
                        theme={dracula}
                        wrapLines={true}
                        codeBlock
                    />
                    </div>
                </Row>
            </Container>
        </div>
        )
};

export default Body;
